import React from 'react'


class UserRegistration extends React.Component {
    render() {
        return (
            <div>
                <h4>Step1</h4>
                <form>
                    <div>
                        <span>Email Id</span>
                    </div>
                    <input type='text' />
                    <input type="submit" value="Submit" />
                </form>
            </div>
        )
    }
}

export default UserRegistration
